INSERT INTO `waka_publisher_contents` (`id`, `data`, `sector_id`, `bloc_id`, `deleted_at`, `created_at`, `updated_at`) VALUES (1, '[{\"value\":\"Restabat ut Caesar post haec properaret accitus et abstergendae causa suspicionis sororem suam, eius uxorem, Constantius ad se tandem desideratam venire multis fictisque blanditiis hortabatur. quae licet ambigeret metuens saepe cruentum, spe tamen quod eum lenire poterit ut germanum profecta, cum Bithyniam introisset, in statione quae Caenos Gallicanos appellatur, absumpta est vi febrium repentina. cuius post obitum maritus contemplans cecidisse fiduciam qua se fultum existimabat, anxia cogitatione, quid moliretur haerebat.\",\"jump\":\"1\"},{\"value\":\"Hae duae provinciae bello quondam piratico catervis mixtae praedonum a Servilio pro consule missae sub iugum factae sunt vectigales. et hae quidem regiones velut in prominenti terrarum lingua positae ob orbe eoo monte Amano disparantur.\",\"jump\":\"0\"}]', NULL, 1, NULL, '2019-12-17 11:19:02', '2019-12-17 11:19:05');
