INSERT INTO `waka_publisher_contents` (`id`, `data`, `sector_id`, `bloc_id`, `deleted_at`, `created_at`, `updated_at`) VALUES (4, '[{\"value\":\"Proinde concepta rabie saeviore, quam desperatio incendebat et fames, amplificatis viribus ardore incohibili in excidium urbium matris Seleuciae efferebantur, quam comes tuebatur Castricius tresque legiones bellicis sudoribus induratae.\",\"jump\":\"1\"},{\"value\":\"Ideoque fertur neminem aliquando ob haec vel similia poenae addictum oblato de more elogio revocari iussisse, quod inexorabiles quoque principes factitarunt. et exitiale hoc vitium, quod in aliis non numquam intepescit, in illo aetatis progressu effervescebat, obstinatum eius propositum accendente adulatorum cohorte.\",\"jump\":\"0\"}]', NULL, 3, NULL, '2019-12-17 15:02:49', '2019-12-17 15:04:17');
INSERT INTO `waka_publisher_contents` (`id`, `data`, `sector_id`, `bloc_id`, `deleted_at`, `created_at`, `updated_at`) VALUES (5, '[{\"value\":\"Et quoniam apud eos ut in capite mundi morborum acerbitates celsius dominantur, ad quos vel sedandos omnis professio medendi torpescit, excogitatum est adminiculum sospitale nequi amicum perferentem similia videat, additumque est cautionibus paucis remedium aliud satis validum, ut famulos percontatum missos quem ad modum valeant noti hac aegritudine colligati, non ante recipiant domum quam lavacro purgaverint corpus. ita etiam alienis oculis visa metuitur labes.\",\"path\":\"\\\\\\/cropped-images\\/montageLinkedin-0-0-0-0-1576595029.jpg\"}]', NULL, 4, NULL, '2019-12-17 15:03:53', '2019-12-17 15:03:56');
